package stateproof

import (
	"encoding/hex"
	"github.com/hashgraph/hedera-state-proof-verifier-go/internal/errors"
	"github.com/stretchr/testify/assert"
	"testing"
)

var (
	validV2RecordStream = []byte(
		`{
		    "record_file": "",
		    "signature_files": {
		        "0.0.4": "",
		        "0.0.3": "",
		        "0.0.6": "",
		        "0.0.5": ""
		    },
		    "address_books": [
		        ""
		    ]
		}`)

	validV5RecordStream = []byte(
		`{
		    "record_file": "",
		    "signature_files": {
		        "0.0.3": "",
		        "0.0.4": "",
		        "0.0.5": "",
		        "0.0.6": "",
		        "0.0.7": ""
		    },
		    "address_books": [
		        ""
		    ]
		}`)
)

const (
	missingTxnID             = "0.0.1893-12345-6784"
	validV2RecordStreamTxnID = "0.0.1893-1605177623-307000000"
	validV5RecordStreamTxnID = "0.0.1893-1612433595-828569590"
)

func TestValidV2RecordStream(t *testing.T) {
	valid, err := Verify(validV2RecordStreamTxnID, validV2RecordStream)

	assert.Nil(t, err)
	assert.True(t, valid)
}

func TestVerificationTransactionNotFound(t *testing.T) {
	valid, err := Verify(missingTxnID, validV2RecordStream)
	assert.Equal(t, errors.ErrorTransactionNotFound, err)
	assert.False(t, valid)

	valid, err = Verify(missingTxnID, validV5RecordStream)
	assert.Equal(t, errors.ErrorTransactionNotFound, err)
	assert.False(t, valid)
}

func TestValidV5RecordStream(t *testing.T) {
	valid, err := Verify(validV5RecordStreamTxnID, validV5RecordStream)

	assert.Nil(t, err)
	assert.True(t, valid)
}

func TestInvalidRecordFileLength(t *testing.T) {
	invalid := []byte(
		`{
		    "record_file": "",
		    "signature_files": {
		        "0.0.3": "",
		        "0.0.4": "",
		        "0.0.5": "",
		        "0.0.6": "",
		        "0.0.7": ""
		    },
		    "address_books": [
		        ""
		    ]
		}`)
	valid, err := Verify(validV5RecordStreamTxnID, invalid)

	assert.Equal(t, errors.ErrorInvalidLength, err)
	assert.False(t, valid)
}

func TestNoRecordFile(t *testing.T) {
	invalid := []byte(
		`{
			"signature_files": {
				"0.0.6": "",
		        "0.0.7": ""
		    }
		}`)
	valid, err := Verify(validV5RecordStreamTxnID, invalid)

	assert.Equal(t, errors.ErrorInvalidRecordFile, err)
	assert.False(t, valid)
}

func TestNoSignatureFiles(t *testing.T) {
	invalid := []byte(
		`{
		    "record_file": "",
		    "signature_files": {
		    },
		    "address_books": [
		        ""
		    ]
		}`)
	valid, err := Verify(validV5RecordStreamTxnID, invalid)

	assert.Equal(t, errors.ErrorInvalidSignaturesLength, err)
	assert.False(t, valid)
}

func TestNoAddressBooks(t *testing.T) {
	invalid := []byte(
		`{
		    "record_file": "",
		    "signature_files": {
		        "0.0.3": "",
		        "0.0.7": ""
		    },
		    "address_books": [
		    ]
		}`)
	valid, err := Verify(validV5RecordStreamTxnID, invalid)

	assert.Equal(t, errors.ErrorInvalidAddressBooksLength, err)
	assert.False(t, valid)
}

func TestInvalidRecordStream(t *testing.T) {
	invalid := []byte(
		`0x1234`)
	valid, err := Verify(validV5RecordStreamTxnID, invalid)

	assert.NotNil(t, err)
	assert.False(t, valid)
}

func TestInvalidSignatureFileDecode(t *testing.T) {
	invalid := []byte(
		`{
		    "record_file": "",
		    "signature_files": {
		        "0.0.3": "BQAAAAH0ItqDolF0HgAAAAFY/",
		        "0.0.7": ""
		    },
		    "address_books": [
		        ""
		    ]
		}`)
	valid, err := Verify(validV5RecordStreamTxnID, invalid)

	assert.NotNil(t, err)
	assert.False(t, valid)
}

func TestVerificationInvalidSignatures(t *testing.T) {
	invalid := []byte(
		`{
		    "record_file": "",
		    "signature_files": {
                "0.0.3": "",
		        "0.0.7": ""		    },
		    "address_books": [
		        ""
		    ]
		}`)
	valid, err := Verify(validV2RecordStreamTxnID, invalid)

	assert.Equal(t, errors.ErrorVerifySignature, err)
	assert.False(t, valid)
}

func TestInvalidAddressBook(t *testing.T) {
	invalid := []byte(
		`{
		    "record_file": "",
		    "signature_files": {
		        "0.0.4": "",
		        "0.0.3": ""
		    },
		    "address_books": [
		        "CtYGGgUwLjAuNSLMBjMwODIwMWEyMzAw"
		    ]
		}`)
	valid, err := Verify(validV2RecordStreamTxnID, invalid)

	assert.NotNil(t, err)
	assert.False(t, valid)
}

func TestVerifySignatureInvalidSignature(t *testing.T) {
	publicKey := ""
	hash, _ := hex.DecodeString("717c96a17bcc6f41f725f0b65899c5902a0326ac6e66e1bb3fc687ae0d4e1032ce0442cdda43b3b92d7e0120c8d7007d")

	result := verifySignature(publicKey, hash, hash)

	assert.False(t, result)
}

func TestValidVerifySignature(t *testing.T) {
	publicKey := ""
	hash, _ := hex.DecodeString("717c96a17bcc6f41f725f0b65899c5902a0326ac6e66e1bb3fc687ae0d4e1032ce0442cdda43b3b92d7e0120c8d7007d")
	signature, _ := hex.DecodeString("")

	result := verifySignature(publicKey, hash, signature)

	assert.True(t, result)
}

func TestVerifySignatureInvalidPublicKey(t *testing.T) {
	publicKey := "x"
	hash, _ := hex.DecodeString("717c96a17bcc6f41f725f0b65899c5902a0326ac6e66e1bb3fc687ae0d4e1032ce0442cdda43b3b92d7e0120c8d7007d")
	signature, _ := hex.DecodeString("")

	result := verifySignature(publicKey, hash, signature)

	assert.False(t, result)
}
